import axios from "axios";
import { API_URL } from ".";

export const getHistorics = async () => {
  return axios
    .get(`${API_URL}/historic`)
    .then(( data ) => {
      console.log("status?",data.status)
      return data;
    })
    .catch((err) => console.log(err));
};
